import React from 'react'

export default class InstructorCourse extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      course: props.course
    }
  }

  render() {
    const keywordList = this.props.course.keywords.map(
      (instructor) => (
        <li>{instructor}</li>
      )
    )
    return(
      <React.Fragment>
        <h5>this.state.course.name</h5>
        <h6>Keywords:</h6>
      </React.Fragment>
    )
  }
}
